import appLocaleData from "react-intl/locale-data/fa";
import saMessages from "../locales/fa_IR.json";

const faLang = {
  messages: {
    ...saMessages,
  },
  locale: "fa-IR",
  data: appLocaleData,
};
export default faLang;
